511229726","edge_media_to_caption":{"edges":[{"node":{"text":"Hallihallo zusammen \ud83d\ude0a\nAch war das ein sch\u00f6ner Sonntag oder?\ud83d\ude0d\u2600\ufe0f\nRichtig geiles Wetter und ich habe es nat\u00fcrlich genutzt wie viele von euch hoffentlich auch \ud83d\ude0b\nJetzt steht nur noch Chilli Milli an und morgen ruft wieder die Arbeit \ud83e\udd37\ud83c\udffc\u200d\u2642\ufe0f\nBei dem was ihr macht viel Spa\u00df und einen sch\u00f6nen Abend \u2764\ufe0f\n\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\nDie Situation mit dem Coronavirus nervt mich echt aufs \u00fcbelste...\nIch mache mir Sorgen um alte Menschen wie z.b um meine Oma aber um mich kein bisschen. Ich bin Fit und habe ein starkes Immunsystem. Da der Fu\u00dfball leider komplett flach liegt, bin ich momentan oft individuelles Training am machen. Heute war ich mit meinem besten Kumpel @marcelburger94 auf dem Platz und wir haben mal sch\u00f6n f\u00fcr 2 1/2 Stunden gekickt. F\u00fcr mich ist es wichtig jetzt in dieser Zeit ohne Training und ohne Spiel fit zu bleiben. Daher nehme ich jede m\u00f6gliche Einheit mit. Aber solche Nachmittage auf dem Bolzplatz erinnern mich an die sch\u00f6ne Zeit fr\u00fcher. Ein alter Fu\u00dfball, Eistee und Fu\u00dfballschuhe und dann Richtung Bolzplatz. Heutzutage leider nicht mehr so vorstellbar. \nEins steht sowas von fest.\nWenn ich mal Kinder haben sollte, werde ich so viel Zeit mit ihnen drau\u00dfen verbringen wie es nur geht und nicht so wie die heutige \u201eTablettgeneration\u201c.\n\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\nEuer Lenoinho \ud83e\udd19\n\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\n#football #soccer #bolzplatz #kick #fussball #bestfriend #happy #happiness #proud #love #life #lifestyle #photo #photography #photooftheday #panorama #instagram #instalike
